INSERT INTO components VALUES(22,'modal - login1','import React, { useState } from "react";\n\nfunction ModalLogin1() {\n  // This is a React component\n  // You must import useState for this \ncomponent to function\n  // Button classnames are pulled from this library\n\n  const [shown, setShown] = useState(false);\n\n  function handleOpen() {\n    setShown(true);\n  }\n\n  function handleClose() {\n    setShown(false);\n  }\n\n  return (\n    <>\n      <button className="btn3" onClick={handleOpen}>\n        {"Modal - Login1"}\n      </button>\n\n      {shown === true ? (\n        <div className="overlay" onClick={handleClose}>\n          <div className="form-login1">\n            <h2>Login</h2>\n            <form>\n              <input type="text" placeholder="Username..."></input>\n              <input type="text" placeholder="Password..."></input>\n              <input type="submit" className="btn3"></input>\n            </form>\n          </div>\n        </div>\n      ) : null}\n    </>\n  );\n}\n\nexport default ModalLogin1;','.overlay {\n  position: fixed;\n  text-align: center;\n  top: 0;\n  bottom: 0;\n  left: 0;\n  right: 0;\n  overflow: hidden;\n  z-index: 1;\n  background: rgba(0, 0, 0, 0.356);\n}\n\n.form-login1 {\n  background-image: url("https://i.ibb.co/4NCGyzZ/loginform.png");\n  background-position: right bottom;\n  background-size: cover;\n  border-radius: 8px;\n  position: relative;\n  height: 22rem;\n  width: fit-content;\n  color: rgb(0, 0, 0);\n  padding: 0 0 1.1% 0;\n  top: 5%;\n  margin: 0 auto 0 auto;\n}\n\n.form-login1 > form {\n  background: rgba(255, 255, 255, 0.603);\n  border-radius: 3px;\n  margin: 5% 2% 10% 2%;\n  padding: 5%;\n}\n\n.form-login1 > h2 {\n  padding: 1%;\n  text-align: left;\n  background: rgba(0, 195, 255, 0.301);\n  border-top-left-radius: 5px;\n  border-top-right-radius: 5px;\n}\n',1,'2022-03-30 01:56:01.918647','2022-03-30 23:24:12.701523');
INSERT INTO components VALUES(23,'btn19','<button className="button btn19">Gradient Button (btn19)</button>','.btn19 {\n  border-radius: 100rem;\n  font-size: 0.7rem;\n  padding: 0.5rem 2rem;\n  color: black;\n  box-shadow: 0 0 6px 0 rgba(157, 96, 212, 0.5);\n  border: solid 4px transparent;\n  background-image: linear-gradient(\n      rgba(255, 255, 255, 0),\n      rgba(255, 255, 255, 0)\n    ),\n    linear-gradient(50deg, #00ff62, #7700ff);\n  background-origin: border-box;\n  box-shadow: 2px 1000px 1px #fff inset;\n}\n\n.btn19:hover {\n  box-shadow: none;\n  color: white;\n}\n\n.btn19:active {\n    background-image: linear-gradient(\n        rgba(255, 255, 255, 0),\n        rgba(255, 255, 255, 0)\n      ),\n      linear-gradient(90deg, #00ff62, #7700ff);\n}',1,'2022-03-30 18:54:15.801223','2022-03-30 18:54:15.801223');
INSERT INTO components VALUES(24,'btn20','<button className="button btn20">Gradient Button (btn20)</button>','.btn20 {\n  border-radius: 10px;\n  font-size: 0.8rem;\n  padding: 0.5rem 3rem;\n  color: rgb(255, 255, 255);\n  box-shadow: 0 0 6px 0 rgba(255, 255, 255, 0.5);\n  border: solid 3px transparent;\n  background-image: linear-gradient(\n      rgba(255, 255, 255, 0),\n      rgba(255, 255, 255, 0)\n    ),\n    linear-gradient(30deg, #ff0000, #000000);\n  background-origin: border-box;\n  box-shadow: none;\n}\n\n.btn20:hover {\n  box-shadow: 2px 1000px 1px #fff inset;\n  background-image: linear-gradient(\n      rgba(255, 255, 255, 0),\n      rgba(255, 255, 255, 0)\n    ),\n    linear-gradient(70deg, #000000, #ff0000);\n\n  color: rgb(0, 0, 0);\n}',1,'2022-03-30 18:54:19.137279','2022-03-30 18:54:19.137279');
INSERT INTO components VALUES(25,'btn21','<button className="button btn21">Gradient Button (btn21)</button>','.btn21 {\n  border-radius: 1rem;\n  font-size: 0.7rem;\n  padding: 0.5rem 2rem;\n  color: black;\n  box-shadow: 0 0 6px 0 rgba(157, 96, 212, 0.5);\n  border: solid 4px transparent;\n  background-image: linear-gradient(\n      rgba(255, 255, 255, 0),\n      rgba(255, 255, 255, 0)\n    ),\n    linear-gradient(45deg, #78e4ff, #ff48fa);\n  background-origin: border-box;\n  box-shadow: 8px 1px 100px #fff inset;\n}\n\n.btn21:hover {\n  box-shadow: none;\n  color: white;\n}',1,'2022-03-30 18:54:24.624335','2022-03-30 18:54:24.624335');
INSERT INTO components VALUES(26,'modal - login2','import React, { useState } from "react";\nimport "./modal-login2.css";\n\nfunction ModalLogin2() {\n    // This is a React component\n  // You must import useState for this component to function\n  const [shown, setShown] = useState(false);\n\n  function handleOpen() {\n    setShown(true);\n  }\n\n  function handleClose() {\n    setShown(false);\n  }\n\n  function randomButton(min, max) {\n    const random = Math.floor(Math.random() * (max - min + 1) + min);\n    return `btn${random}`;\n  }\n\n  return (\n    <>\n      <button className={`${randomButton(3, 21)} small-margin`} onClick={handleOpen}>\n        {"Modal - Login2"}\n      </button>\n\n      {shown === true ? (\n        <div className="overlay" onClick={handleClose}>\n          <div className="form-login2">\n            <h2>Login</h2>\n            <form>\n              <input type="text" placeholder="Username..."></input>\n              <input type="text" placeholder="Password..."></input>\n              <input type="submit" className="btn19"></input>\n            </form>\n          </div>\n        </div>\n      ) : null}\n    </>\n  );\n}\n\nexport default ModalLogin2;','.overlay {\n    position: fixed;\n    text-align: center;\n    top: 0;\n    bottom: 0;\n    left: 0;\n    right: 0;\n    overflow: hidden;\n    z-index: 1;\n    background: rgba(0, 0, 0, 0.356);\n  }\n  \n  .form-login2 {\n    background-image: url("https://i.ibb.co/VN60yMy/trees-in-the-ocean-Trading-Card.jpg");\n    background-position: center;\n    background-size: cover;\n    border-radius: 8px;\n    position: absolute;\n    height: 19rem;\n    width: 20rem;\n    color: rgb(0, 0, 0);\n    padding: 0 0 1.1% 0;\n    top: 5%;\n    right: 5%;\n    margin: 0 auto 0 auto;\n  }\n  \n  .form-login2 > form {\n    background: rgba(255, 255, 255, 0.603);\n    border-radius: 3px;\n    margin: 39.5% 2% 0 2%;\n    padding: 5%;\n  }\n  \n  .form-login2 > h2 {\n    padding: 1%;\n    padding-right: 3rem;\n    text-align: right;\n    font-family: ''Times New Roman'', Times, serif;\n    color: rgb(209, 209, 209);\n    border-top-left-radius: 5px;\n    border-top-right-radius: 5px;\n  }\n  ',1,'2022-03-30 19:52:43.499464','2022-03-30 23:24:42.675677');
INSERT INTO components VALUES(27,'modal - simple','import React, { useState } from "react";\nimport "./modal-simple.css";\n\nfunction ModalSimple() {\n  const [shown, setShown] = useState(false);\n\n  function handleOpen() {\n    setShown(true);\n  }\n\n  function handleClose() {\n    setShown(false);\n  }\n\n  function randomButton(min, max) {\n    const random = Math.floor(Math.random() * (max - min + 1) + min);\n    return `btn${random}`;\n  }\n\n  return (\n    <>\n      <button className={`${randomButton(3, 21)} small-margin`} onClick={handleOpen}>\n        {"Modal - Simple"}\n      </button>\n\n      {shown === true ? (\n        <div className="overlay">\n          <div className="simple-modal segment">\n            <header>\n              <button className="btn15" onClick={handleClose}>\n                X\n              </button>\n            </header>\n            <hr />\n            <h1>\n              Place Content Here\n              <br />\n              Place Content Here\n              <br />\n              Place Content Here\n              <br />\n              Place Content Here\n              <br />\n              Place Content Here\n              <br />\n              Place Content Here\n              <br />\n            </h1>\n          </div>\n        </div>\n      ) : null}\n    </>\n  );\n}\n\nexport default ModalSimple;','.simple-modal > header {\n    text-align: right;\n}\n\n.overlay {\n  position: fixed;\n  text-align: center;\n  top: 0;\n  bottom: 0;\n  left: 0;\n  right: 0;\n  overflow: hidden;\n  z-index: 1;\n  background: rgba(0, 0, 0, 0.356);\n}\n\n.simple-modal {\n  position: relative;\n  max-width: 90%;\n  max-height: 70%;\n  background: white;\n  color: rgb(0, 0, 0);\n  padding: 2%;\n  top: 5%;\n  margin: auto;\n  word-wrap: break-word;\n  overflow: auto;\n}\n',1,'2022-03-30 19:58:19.963768','2022-03-30 23:25:23.172569');
INSERT INTO components VALUES(28,'form - simple','import React from "react";\nimport "./form-simple.css"\n\nfunction FormSimple() {\n  function handleChange(e) {\n    e.preventDefault();\n  }\n\n  return (\n    <div className="form-simple">\n      <form onSubmit={handleChange}>\n        <input\n          type="text"\n          className="form-input"\n          placeholder="Username"\n        ></input>\n        <br />\n        <input\n          type="text"\n          className="form-input"\n          placeholder="Password"\n        ></input>\n        <br />\n        <input type="text" className="form-input" placeholder="Email"></input>\n        <br />\n        <input type="text" className="form-input" placeholder="Phone"></input>\n        <br />\n        <input\n          type="text"\n          className="form-input"\n          placeholder="Whatever You Want"\n        ></input>\n        <br />\n        <input type="submit" className="btn6"></input>\n        <br />\n      </form>\n    </div>\n  );\n}\n\nexport default FormSimple;','.form-simple {\n    background: rgb(228, 228, 228);\n    border-radius: 8px;\n    padding: 2%;\n    text-align: center;\n    width: fit-content;\n    margin: auto;\n}',1,'2022-03-30 23:00:39.558033','2022-03-30 23:00:39.558033');
